import Player1 from "./player1.js";
import Player2 from "./player2.js";
import Layout from "./Layout.js";



function App() {
  return (
    <div>
      <Layout/>

    <div className="container-fluid" >
      <div className="row">
        <div className="col text-center">
          <Player1 />
        </div>
        <div className="col text-center">
          <Player2 />
        </div>
      </div>
    </div>
    </div>
  );
}

export default App;
